import NewsItem from './NewsItem'

export class News extends Component {
  render() {
    return (
      <div className='container my-3'>
        <h2>NewsLelo - Top Headlines</h2>
        <div className="row">
        <div className="col-md-3">
          <NewsItem title={"MY TITLE"} description={"My desc"}/>
        </div>
        </div>
      </div>
    )
  }
}

export default News
